import React, {Component} from 'react'
import '../../normalize.scss'
import '../../base.scss'
import ComponentRegras from '../../components/Regras/index';
import Banner from '../../components/Header/Banner';
import imgBanner from '../../components/Header/Banner/destaques/Regras/1280.png';
import View from "../view/view"


class Regras extends Component {

  render() {
    let contentBanner = "Conheça as regras do jogo"
    return (
      <View public={true}>
        <Banner imagemBanner={imgBanner} text={contentBanner}/>
        <ComponentRegras />
       </View>
    )   
  }
}

export default Regras
